sourcesContent:
import GroupComponent from "../components/GroupComponent";
import { css } from "@emotion/css";
import NavItem from "../components/NavItem";
import UserInfo from "../components/UserInfo";

const DASHBOARD = () => {
  return (
    <div
      className={css`
        width: 100%;
        height: 1184px;
        position: relative;
        background-color: #fff2b2;
        overflow: hidden;
        display: flex;
        flex-direction: row;
        align-items: flex-start;
        justify-content: flex-start;
        padding: 223px 0px 0px;
        box-sizing: border-box;
        gap: 486px;
        line-height: normal;
        letter-spacing: normal;
        text-align: left;
        font-size: 14.6px;
        color: #4b4b4b;
        font-family: Poppins;
        @media screen and (max-width: 1200px) {
          gap: 243px;
        }
        @media screen and (max-width: 750px) {
          gap: 121px;
          padding-left: 20px;
          padding-right: 20px;
          box-sizing: border-box;
        }
        @media screen and (max-width: 450px) {
          gap: 61px;
        }
      `}
    >
      <div
        className={css`
          margin-top: -229px;
          width: 314px;
          box-shadow: 0px 3px 35.16px rgba(0, 0, 0, 0.08);
          background-color: #fff;
          display: flex;
          flex-direction: column;
          align-items: flex-start;
          justify-content: flex-start;
          padding: 6px 0px 0px;
          box-sizing: border-box;
          gap: 441.3px;
          @media screen and (max-width: 750px) {
            display: none;
          }
          @media screen and (max-width: 450px) {
            gap: 221px;
          }
        `}
      >
        <div
          className={css`
            align-self: stretch;
            height: 682.7px;
            display: flex;
            flex-direction: column;
            align-items: flex-end;
            justify-content: flex-start;
            padding: 229px 0px 0px;
            box-sizing: border-box;
            gap: 43px;
            @media screen and (max-width: 1050px) {
              padding-top: 149px;
              padding-bottom: 20px;
              box-sizing: border-box;
            }
            @media screen and (max-width: 450px) {
              gap: 21px;
              padding-top: 97px;
              box-sizing: border-box;
            }
          `}
        >
          <GroupComponent />
          <div
            className={css`
              align-self: stretch;
              display: flex;
              flex-direction: row;
              align-items: flex-start;
              justify-content: flex-end;
              padding: 0px 22px 0px 23px;
            `}
          >
            <div
              className={css`
                flex: 1;
                display: flex;
                flex-direction: column;
                align-items: flex-start;
                justify-content: flex-start;
                position: relative;
                gap: 14.6px;
                flex-shrink: 0;
              `}
            >
              <div
                className={css`
                  width: 253.4px;
                  border-radius: 3.66px;
                  background-color: #fff;
                  display: flex;
                  flex-direction: row;
                  align-items: center;
                  justify-content: space-between;
                  padding: 0px 7px;
                  box-sizing: border-box;
                  gap: 13.25px;
                `}
              >
                <div
                  className={css`
                    display: flex;
                    flex-direction: row;
                    align-items: center;
                    justify-content: center;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.3px 7px;
                    `}
                  >
                    <img
                      className={css`
                        height: 29.3px;
                        width: 29.3px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                      loading="lazy"
                      alt=""
                      src="/chat.svg"
                    />
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.4px 7px 7.2px;
                    `}
                  >
                    <div
                      className={css`
                        position: relative;
                        letter-spacing: 0.01em;
                        line-height: 22px;
                      `}
                    >
                      Home (Dashboard)
                    </div>
                  </div>
                </div>
                <div
                  className={css`
                    height: 22px;
                    width: 22px;
                    display: flex;
                    flex-direction: row;
                    align-items: flex-start;
                    justify-content: flex-start;
                    font-size: 11.9px;
                    color: #1e252b;
                  `}
                >
                  <div
                    className={css`
                      display: none;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <div
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        border-radius: 3.66px;
                        background-color: #e9f5fe;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                    >
                      <div
                        className={css`
                          position: absolute;
                          top: -1.8px;
                          left: 8.2px;
                          line-height: 26.53px;
                        `}
                      >
                        1
                      </div>
                    </div>
                  </div>
                  <div
                    className={css`
                      display: none;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <img
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                        object-fit: contain;
                      `}
                      alt=""
                      src="/arrow--right-2@2x.png"
                    />
                  </div>
                </div>
              </div>
              <div
                className={css`
                  align-self: stretch;
                  box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
                  border-radius: 3.66px;
                  background-color: #f0f6ff;
                  display: flex;
                  flex-direction: row;
                  align-items: center;
                  justify-content: flex-start;
                  padding: 0px 7px;
                `}
              >
                <div
                  className={css`
                    display: flex;
                    flex-direction: row;
                    align-items: center;
                    justify-content: center;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.4px 7px 7.2px;
                    `}
                  >
                    <img
                      className={css`
                        height: 29.3px;
                        width: 29.3px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                      alt=""
                      src="/edit-square.svg"
                    />
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.3px 7px;
                    `}
                  >
                    <div
                      className={css`
                        position: relative;
                        letter-spacing: 0.01em;
                        line-height: 22px;
                        font-weight: 600;
                        display: inline-block;
                        min-width: 79px;
                      `}
                    >
                      Asset Lists
                    </div>
                  </div>
                </div>
                <div
                  className={css`
                    display: none;
                    flex-direction: row;
                    align-items: flex-start;
                    justify-content: flex-start;
                    font-size: 11.9px;
                    color: #0c7fda;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <div
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        border-radius: 3.66px;
                        background-color: #fff;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                    >
                      <div
                        className={css`
                          position: absolute;
                          top: -1.8px;
                          left: 8.2px;
                          line-height: 26.53px;
                        `}
                      >
                        1
                      </div>
                    </div>
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <img
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                        object-fit: contain;
                      `}
                      alt=""
                      src="/arrow--right-2-1@2x.png"
                    />
                  </div>
                </div>
              </div>
              <div
                className={css`
                  align-self: stretch;
                  border-radius: 3.66px;
                  background-color: #fff;
                  display: flex;
                  flex-direction: row;
                  align-items: center;
                  justify-content: flex-start;
                  padding: 0px 7px;
                  font-size: 16px;
                `}
              >
                <div
                  className={css`
                    display: flex;
                    flex-direction: row;
                    align-items: center;
                    justify-content: center;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.3px 7px;
                    `}
                  >
                    <img
                      className={css`
                        height: 29.3px;
                        width: 29.3px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                      alt=""
                      src="/edit-square-1.svg"
                    />
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.3px 7px;
                    `}
                  >
                    <div
                      className={css`
                        position: relative;
                        letter-spacing: 0.01em;
                        line-height: 22px;
                        display: inline-block;
                        min-width: 115px;
                      `}
                    >
                      Asset Request
                    </div>
                  </div>
                </div>
                <div
                  className={css`
                    display: none;
                    flex-direction: row;
                    align-items: flex-start;
                    justify-content: flex-start;
                    font-size: 11.9px;
                    color: #0c7fda;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <div
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        border-radius: 3.66px;
                        background-color: #fff;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                    >
                      <div
                        className={css`
                          position: absolute;
                          top: -1.8px;
                          left: 8.2px;
                          line-height: 26.53px;
                        `}
                      >
                        1
                      </div>
                    </div>
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <img
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                        object-fit: contain;
                      `}
                      alt=""
                      src="/arrow--right-2-2@2x.png"
                    />
                  </div>
                </div>
              </div>
              <NavItem
                dashboard="Asset History"
                arrowRight2="/arrow--right-2-3@2x.png"
                propDisplay="inline-block"
                propMinWidth="104px"
              />
              <NavItem
                dashboard="Finance Tracking"
                arrowRight2="/arrow--right-2-4@2x.png"
                propDisplay="unset"
                propMinWidth="unset"
              />
              <NavItem
                dashboard="Events Management"
                arrowRight2="/arrow--right-2-5@2x.png"
                propDisplay="unset"
                propMinWidth="unset"
              />
              <div
                className={css`
                  align-self: stretch;
                  border-radius: 3.66px;
                  background-color: #fff;
                  display: flex;
                  flex-direction: row;
                  align-items: center;
                  justify-content: flex-start;
                  padding: 0px 7px;
                  font-size: 16px;
                `}
              >
                <div
                  className={css`
                    display: flex;
                    flex-direction: row;
                    align-items: center;
                    justify-content: center;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.3px 7px;
                    `}
                  >
                    <img
                      className={css`
                        height: 29.3px;
                        width: 29.3px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                      alt=""
                      src="/edit-square-5.svg"
                    />
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: center;
                      justify-content: center;
                      padding: 7.3px 7px;
                    `}
                  >
                    <div
                      className={css`
                        position: relative;
                        letter-spacing: 0.01em;
                        line-height: 22px;
                        display: inline-block;
                        min-width: 84px;
                      `}
                    >
                      Audit Logs
                    </div>
                  </div>
                </div>
                <div
                  className={css`
                    display: none;
                    flex-direction: row;
                    align-items: flex-start;
                    justify-content: flex-start;
                    font-size: 11.9px;
                    color: #0c7fda;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <div
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        border-radius: 3.66px;
                        background-color: #fff;
                        overflow: hidden;
                        flex-shrink: 0;
                      `}
                    >
                      <div
                        className={css`
                          position: absolute;
                          top: -1.8px;
                          left: 8.2px;
                          line-height: 26.53px;
                        `}
                      >
                        1
                      </div>
                    </div>
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <img
                      className={css`
                        height: 22px;
                        width: 22px;
                        position: relative;
                        overflow: hidden;
                        flex-shrink: 0;
                        object-fit: contain;
                      `}
                      alt=""
                      src="/arrow--right-2-6@2x.png"
                    />
                  </div>
                </div>
              </div>
              <NavItem
                dashboard="User Management"
                arrowRight2="/arrow--right-2-7@2x.png"
              />
              <div
                className={css`
                  width: 41px;
                  margin: 0 !important;
                  position: absolute;
                  top: 120px;
                  right: -7px;
                  background-color: #ff5959;
                  display: flex;
                  flex-direction: row;
                  align-items: flex-start;
                  justify-content: flex-start;
                  padding: 8px 18px;
                  box-sizing: border-box;
                  z-index: 1;
                  font-size: 12px;
                `}
              >
                <div
                  className={css`
                    height: 38px;
                    width: 41px;
                    position: relative;
                    background-color: #ff5959;
                    display: none;
                  `}
                />
                <div
                  className={css`
                    position: relative;
                    letter-spacing: 0.01em;
                    line-height: 22px;
                    background: linear-gradient(
                        rgba(0, 0, 0, 0.2),
                        rgba(0, 0, 0, 0.2)
                      ),
                      #fff;
                    -webkit-background-clip: text;
                    -webkit-text-fill-color: transparent;
                    display: inline-block;
                    min-width: 4px;
                    z-index: 2;
                  `}
                >
                  1
                </div>
              </div>
            </div>
          </div>
        </div>
        <div
          className={css`
            align-self: stretch;
            display: flex;
            flex-direction: row;
            align-items: flex-start;
            justify-content: flex-start;
          `}
        >
          <button
            className={css`
              cursor: pointer;
              border: none;
              padding: 19px 49px 17px;
              background-color: #d9d9d9;
              flex: 1;
              display: flex;
              flex-direction: row;
              align-items: flex-start;
              justify-content: flex-start;
              z-index: 6;
            `}
          >
            <div
              className={css`
                height: 60px;
                width: 157px;
                position: relative;
                background-color: #d9d9d9;
                display: none;
              `}
            />
            <div
              className={css`
                height: 48px;
                width: 44px;
                display: none;
              `}
            />
            <a
              className={css`
                text-decoration: none;
                position: relative;
                font-size: 12px;
                letter-spacing: 0.01em;
                line-height: 24px;
                font-family: Poppins;
                background: linear-gradient(
                    rgba(0, 0, 0, 0.2),
                    rgba(0, 0, 0, 0.2)
                  ),
                  #262626;
                -webkit-background-clip: text;
                -webkit-text-fill-color: transparent;
                text-align: left;
                display: inline-block;
                min-width: 50px;
                z-index: 7;
              `}
            >
              Settings
            </a>
          </button>
          <button
            className={css`
              cursor: pointer;
              border: none;
              padding: 19px 52px 17px;
              background-color: #4e4e4e;
              display: flex;
              flex-direction: row;
              align-items: flex-start;
              justify-content: flex-start;
              z-index: 6;
            `}
          >
            <div
              className={css`
                height: 60px;
                width: 157px;
                position: relative;
                background-color: #4e4e4e;
                display: none;
              `}
            />
            <div
              className={css`
                height: 48px;
                width: 44px;
                display: none;
              `}
            />
            <div
              className={css`
                position: relative;
                font-size: 12px;
                letter-spacing: 0.01em;
                line-height: 24px;
                font-family: Poppins;
                background: linear-gradient(
                    rgba(0, 0, 0, 0.2),
                    rgba(0, 0, 0, 0.2)
                  ),
                  #fff;
                -webkit-background-clip: text;
                -webkit-text-fill-color: transparent;
                text-align: left;
                display: inline-block;
                min-width: 52px;
                z-index: 7;
              `}
            >
              Sign Out
            </div>
          </button>
        </div>
      </div>
      <div
        className={css`
          width: 566px;
          display: flex;
          flex-direction: column;
          align-items: flex-start;
          justify-content: flex-start;
          max-width: calc(100% - 800px);
          flex-shrink: 0;
          @media screen and (max-width: 750px) {
            max-width: 100%;
          }
        `}
      >
        <div
          className={css`
            align-self: stretch;
            border-radius: 26px;
            background-color: #f7cc5f;
            display: flex;
            flex-direction: row;
            align-items: flex-start;
            justify-content: center;
            padding: 23px 20px 39px 23px;
            box-sizing: border-box;
            max-width: 100%;
          `}
        >
          <div
            className={css`
              height: 283px;
              width: 566px;
              position: relative;
              border-radius: 26px;
              background-color: #f7cc5f;
              display: none;
              max-width: 100%;
            `}
          />
          <img
            className={css`
              height: 221px;
              width: 221px;
              position: relative;
              border-radius: 50%;
              object-fit: cover;
              z-index: 1;
            `}
            loading="lazy"
            alt=""
            src="/ellipse-20@2x.png"
          />
        </div>
        <UserInfo />
      </div>
    </div>
  );
};

export default DASHBOARD;
